import React from "react";
import "./Contact.css";

const Contact = () => {
  // 기능 구현 로직
  return (
    <div id="contact">
      <div class="Contact">
        <h1>Contact</h1>
        <div class="contact-box-wraper">
          <div class="contact-box"></div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
